import React from 'react';

const ImageTest = () => {
  return (
    <div style={{ padding: '20px', background: '#f0f0f0' }}>
      <h2>Teste de Imagens</h2>
      
      <div style={{ marginBottom: '20px' }}>
        <h3>Logo Principal:</h3>
        <img 
          src={process.env.PUBLIC_URL + "/logo.png"} 
          alt="Logo Test" 
          style={{ width: '100px', height: '100px', border: '1px solid red' }}
          onError={(e) => {
            console.log("Erro ao carregar logo:", e.target.src);
            e.target.style.display = 'none';
          }}
          onLoad={() => {
            console.log("Logo carregado com sucesso!");
          }}
        />
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h3>Favicon:</h3>
        <img 
          src={process.env.PUBLIC_URL + "/favicon.ico"} 
          alt="Favicon Test" 
          style={{ width: '32px', height: '32px', border: '1px solid red' }}
          onError={(e) => {
            console.log("Erro ao carregar favicon:", e.target.src);
            e.target.style.display = 'none';
          }}
          onLoad={() => {
            console.log("Favicon carregado com sucesso!");
          }}
        />
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h3>Logo 192:</h3>
        <img 
          src={process.env.PUBLIC_URL + "/logo192.png"} 
          alt="Logo 192 Test" 
          style={{ width: '100px', height: '100px', border: '1px solid red' }}
          onError={(e) => {
            console.log("Erro ao carregar logo192:", e.target.src);
            e.target.style.display = 'none';
          }}
          onLoad={() => {
            console.log("Logo192 carregado com sucesso!");
          }}
        />
      </div>

      <div>
        <h3>Informações do Ambiente:</h3>
        <p>PUBLIC_URL: {process.env.PUBLIC_URL}</p>
        <p>NODE_ENV: {process.env.NODE_ENV}</p>
      </div>
    </div>
  );
};

export default ImageTest;
